import { StatusBar } from 'expo-status-bar';
import * as React from 'react';
import { Text, View, StyleSheet, ScrollView, TextInput, Button, TouchableOpacity, SafeAreaView, FlatList, Image, Rating, AirbnbRating } from 'react-native';

class ChangePassword extends React.Component {
    render() {
        const navigation = this.props.navigation;
        return (
            <ScrollView style={{ backgroundColor: '#FFFFFF' }}>
                <View style={styles.container}>
                    <StatusBar style="auto" />
                    <Image
                        style={{
                            width: 140,
                            height: 140,
                            marginTop: 26
                        }}
                        resizeMode={'cover'}
                        source={require('../assets/change_password.png')}
                    />
                    <Text
                        style={{
                            fontSize: 18,
                            marginBottom: 8,
                            marginTop: 16,
                            fontWeight: 'bold'
                        }}>Change Passowrd</Text>
                    <Text
                        style={{
                            textAlign: 'left',
                            marginBottom: 24,
                            color: '#4D4D4D',
                            fontWeight: 'bold',
                            width: "94%",
                        }}
                    >Please fill the below fields details for new password</Text>

                    <Text
                        style={{
                            textAlign: 'left',
                            marginStart: 8,
                            marginBottom: 8,
                            color: '#4D4D4D',
                            fontWeight: 'bold',
                            width: "94%",
                        }}
                    >Current Password</Text>
                    <TextInput
                        style={{
                            height: 40,
                            width: "94%",
                            padding: 10,
                            borderRadius: 4,
                            borderColor: 'gray',
                            backgroundColor: '#FFFFFF',
                            borderWidth: 1
                        }}
                        placeholder="Enter Current Password "
                        defaultValue=""
                    />
                    <Text
                        style={{
                            textAlign: 'left',
                            marginStart: 8,
                            marginBottom: 8,
                            color: '#4D4D4D',
                            marginTop: 16,
                            fontWeight: 'bold',
                            width: "94%",
                        }}
                    >New Password</Text>
                    <TextInput
                        style={{
                            height: 40,
                            width: "94%",
                            padding: 10,
                            borderRadius: 4,
                            borderColor: 'gray',
                            backgroundColor: '#FFFFFF',
                            borderWidth: 1,
                        }}
                        placeholder="New Password"
                        defaultValue=""
                    />

                    <Text
                        style={{
                            textAlign: 'left',
                            marginStart: 8,
                            marginBottom: 8,
                            color: '#4D4D4D',
                            marginTop: 16,
                            fontWeight: 'bold',
                            width: "94%",
                        }}
                    >Confirm Password</Text>
                    <TextInput
                        style={styles.textInput}
                        placeholder="Confirm Password"
                        defaultValue=""
                    />

                    <View style={[{
                        width: "94%",
                        marginStart: 10,
                        marginEnd: 10,
                        marginTop: 24,
                        marginBottom: 40,
                        backgroundColor: "#00C8E4",
                        borderRadius: 4,
                    }]}>
                        <Button
                            title="Change Password"
                            color="#00C8E4"
                            onPress={() =>
                                navigation.navigate('SettingStack')
                            }
                        />
                    </View>
                </View>
            </ScrollView>
        );
    }
}

export default ChangePassword;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
        justifyContent: 'center',
    },
    logo: {
        width: 66,
        height: 58,
    },
    buttonContainer: {
        width: '100%',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'center',
    },
    checkboxContainer: {
        flexDirection: "row",
        marginBottom: 20,
    },
    textHeading: {
        width: '47%',
        fontSize: 18,
        marginStart: 16,
        marginBottom: 16,
        marginTop: 32,
        fontWeight: 'bold'
    },
    textLabel: {
        textAlign: 'left',
        marginStart: 8,
        marginBottom: 8,
        color: '#4D4D4D',
        marginTop: 16,
        fontWeight: 'bold',
        width: "94%",
    },
    textInput: {
        height: 40,
        width: "94%",
        padding: 10,
        borderRadius: 4,
        borderColor: 'gray',
        backgroundColor: '#FFFFFF',
        borderWidth: 1,
    },

    buttonStyle: {
        width: "46%",
        marginEnd: 8,
        backgroundColor: "#00C8E4",
        borderRadius: 40,
    },
    buttonStyleWhite: {
        width: "46%",
        marginEnd: 8,
        backgroundColor: "#E6E6E6",
        borderRadius: 40,
    },
    containerList: {
        width: "100%",
        marginTop: StatusBar.currentHeight || 0,
    },
    item: {
        backgroundColor: '#FFFFFF',
        padding: 8,
        width: "92%",
        alignItems: 'center',
        justifyContent: 'center',
        borderRadius: 8,
        marginVertical: 8,
        marginHorizontal: 16,
    },
    title: {
        fontSize: 32,
    },
    textBorder: {
        width: "50%",
        fontSize: 11,
        color: '#333333',
        fontWeight: 'bold',
        marginTop: 4,
        marginEnd: 4,
        marginStart: 4,
        borderRadius: 4,
        borderColor: '#E6E6E6',
        borderWidth: 1, padding: 4
    },
});
